import ChatBot from "react-simple-chatbot";
import "./Chat.css";

function Chat() {
  return (
    <ChatBot
      headerTitle={"Conversa com DermaBot"}
      steps={[
        {
          id: "greeting",
          message: "Oi, sou a DermaBot!",
          trigger: "skin-type",
        },
        {
          id: "skin-type",
          message:
            "Voce diria que tem a pele seca ou oleosa?",
          options: [
            {
              value: 1,
              label: "Oleosa",
              trigger: "oleosa",
            },
            {
              value: 2,
              label: "Seca",
              trigger: "seca",
            },
          ],
        },
        {},
      ]}
    />
  );
}

export default Chat;
